import Link from 'next/link'


const Navbar = () => (
    <div>
        <ul>
            <li><Link href="/"><button>Home</button></Link></li>
            <li><Link href="/about"><button>About</button></Link></li>
        </ul>

<style jsx>{`
    ul{
        background: #333;
        color: #fff;
        list-style: none;
        display: flex;

    }

    ul li {
        font-size: 18;
        margin-right: 20;
    }

    ul li a {
        color: #fff;
        text-decoration: none;
    }
`}</style>
    </div>
);

export default Navbar
